import { Text, View, Image, ScrollView, TouchableOpacity } from "react-native";
import { Style } from "./SharedStyle";
import room_image from "../assets/room_image.jpg";

export default function RoomDetailsScreen({ navigation, route }) {
  const { item } = route.params;
  return (
    <View style={Style.room_screen_container}>
      <View style={Style.room_screen_container_title}>
        <Image style={Style.room_details_group_image} source={room_image} />
        <View style={Style.room_details_group_title_wrapper}>
          <Text style={Style.room_details_group_title}>
            Group 6 Consultation
          </Text>
          <Text style={Style.room_details_group_createdAt}>
            Created on 11/30/2022
          </Text>
        </View>
      </View>
      <View style={Style.room_screen_container_desciption}>
        <Text style={Style.room_screen_container_desciption_title}>
          {item.body}
        </Text>
      </View>
      <TouchableOpacity
        onPress={() =>
          navigation.push("Members", {
            item: item,
          })
        }
      >
        <Text>Click me!</Text>
      </TouchableOpacity>
    </View>
  );
}
